import React from "react";
import ReactDOM from "react-dom";
import dark from './dark.jpg'; 
import Money from './Money.jpg'; 
import Strange from './Strange.jpg'; 
import Card from "./Cards";



ReactDOM.render(
                <>
                <h1>List of Top 5 Netflix web Series</h1>
                  <Card imgSrc={dark} title="Netflix Orignal Series" sname="Dark" link="https://www.netflix.com/in/title/80100172"/>
                  <Card imgSrc={Money} title="Netflix Orignal Series" sname="Money Heist" link="https://www.netflix.com/in/title/80192098"/>
                  <Card imgSrc={Strange} title="Netflix Orignal Series" sname="Stranger Things" link="https://www.netflix.com/in/title/80057281"/>
                </>,
                document.getElementById("root")

);
